def iniprem(n):
    prem = [2,3,5,7]
    for i in range(10,n+1):
        k = 0
        b = True
        while prem[k] < sqrt(i):
            if i%prem[k] == 0:
                b = False
                break
            else:
                k += 1
        if b:
            prem.append( i )
    return prem

def isprem(i, p):
    k = 0
    b = True
    while p[k] < sqrt(i):
        if i%p[k] == 0:
            b = False
            break
        else:
            k += 1
    return b

